В Насиминском  районе,  недалеко  от  метро  28  Мая,  по  улице  С. Вургун,  престижном  комплексе  ПРЕМИУМ КЛАССА  «Vurgun Residence» продается  3-х  комнатная  квартира.  20/7  этаж.  Общая  площадь  145  кв.м.  Отличный  ремонт.  Витражные  окна.  Документы  КУПЧАЯ.  Для  жильцов  комплекса  предусмотрено:

Бассейн, фитнес, Спа 
•	Салон красоты, солярий
•	Волейбольная площадка, мини-футбольное поле;
•	Детский сад, образовательный центр;
•	Кафе, ресторан;
•	4-уровневая подземная стоянка;
•	Охранная и пожарная сигнализация;
•	Сервисная служба.

Nəsimi rayonu,  28 May metrosu, S.Vurğun kuçesinde,  Rezidens MTK-ya məxsus 20 mərtəbəli binanin 7-ci mərtəbəsində  yerləşən  möhtəşəm   3 otaqlı  mənzil  satılır.  Ümumi  sahəsi   145 kv.m.-dən  ibarətdir.  Əla  təmir.  Qaz,  işıq,  su  daimdir.  Sənədlər  qaydasındadır.  Kupça

Təcili!
Dənizkənarı bulvardan 500 m. məsafədə və şəhər mərkəzində yerləşən Yeni Hayat Şirkətinin unikal layihəsi olan Park Azure yaşayış kompleksində 2 ədəd qarajlı 141 kv.m-dən ibarət 3 otaqlı mənzil satılır.
Park Azure kompleksinin üstünlükləri:
- Geniş, müasir Fitnes və SPA;
- Müasir uşaq bağcası;
- Bravo hipermarketi;
- Uşaq əyləncə mərkəzi və restoranlar, mağazalar eləcə də xidmət göstərən digər iaşə obyektləri olan AVM (kompleksdən bir başa Megafun əyləncə mərkəzinə (AVM) keçid);
- Rahat və geniş avtodayanacaq sahəsi;
- Qapalı həyətyanı sahə;
- Kompleksə 24 saat təhlükəsizlik xidmətinin göstərilməsi;
Qarajla qiymət 300 min
Qeyd - Komplkes çıxarışla təmin olunub, qazlaşdırılıb və yaşayış var.

Nərimanov rayonu, Nərimanov Park və m/s-nın yaxınlığında inşa edilmiş yüksək keyfiyyətli yeni tikilidə 1 otaqlıdan 2 otağa düzəldilmiş əla təmirli mənzil satılır. Təmirdən sonra yaşayış olmayıb.
Mənzilin təmirində bahalı material və aksesuarlardan istifadə olunub.

Yeni tikili təchiz olunur:

- «Hyundai» bir sərnişin və bir yük lifti;
- Domofon sistemi;
- Müasir mühəndis kommunikasiyaları;
- Ehtiyat generator ilə fasiləsiz elektrik enerjisi verilməsi sistemi.

Binanın yerüstü və 1 mərtəbəli yeraltı dayanacağı var...
